        "library(dplyr)\n",
        "library(readr)\n",
        "library(ggplot2)\n",
        "\n",
        "# Reading in the McGill Billboard chord data\n",
        "bb <- read_csv('datasets/bb_chords.csv')\n",
        "\n",
        "# Taking a look at the first rows in bb\n",
        "bb %>% head()"
